UPDATE `quest_template` SET `QuestDescription`='You want to learn how these wasps are so good at harvesting pollen, but dey will defend their territory once you set foot inside it. Dis would be a problem, but I think I have a solution.$b$bTake dis potion and go to Vol\'dun, to de Prickly Grove, and drink it to turn into a plant.$b$bHere\'s the deal: you go out and drink the potion, you\'ll see firsthand how the wasps do what they do. After the potion wears off, you tell me what happened.', `VerifiedBuild`=31478 WHERE `ID`=51448; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='While gathering the pollen, you found a dead wasp absolutely covered in pollen.  You know that this little creature is the secret to harvesting pollen easier, but the answer seems just out grasp.$b$bMaybe if you ask Jahden about it, he might have an idea.', `VerifiedBuild`=31478 WHERE `ID`=51447; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Blighted Lands... \n\nIf the legends are true then inside we will witness suffering and torment the likes of which we have never known. ..\n\n...but if that is what I must endure to right what I have wronged, then I will cross that threshold gladly.\n\nWill you join me, $c?', `VerifiedBuild`=31478 WHERE `ID`=51445; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Ai\'twen saved many Tortollans during the great purge of the Inky Grotto. He rests here in this tranquil bubble as a reward for his service.  To entice him back to our world we\'ll need a flavorful offering.\n\nThe seaweed that grows outside is Ai\'twen\'s favorite meal. Its salty flavor will surely coax Ai\'twen to leave the bubble for our world. Gather it from the creatures outside this cave, and where it grows wild on the reef.', `VerifiedBuild`=31478 WHERE `ID`=51371; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I\'m surprised this snake-man is alive, let alone able to speak. Look at this! \n\n<Ermey holds up a needle-like barb.>\n\nIt looks like it came from one of those giant insects wandering about in the bottom of the gulch. I\'ll bet my stripes it\'s poisoned.\n\nYou know what they say, that which kills can also cure.\n\nGo get a few more of these barbs, I bet if I mix it in with that cactus he\'s wanting we will get a good antivenom to treat his wounds.', `VerifiedBuild`=31478 WHERE `ID`=51351; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='While gathering the pollen, you found a dead bug absolutely covered in pollen.  You know that this little creature is the secret to harvesting pollen easier, but the answer seems just out grasp.$b$bMaybe if you ask Declan about it, he might have an idea.', `VerifiedBuild`=31478 WHERE `ID`=51312; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Riverbud is a precious resource for us. Not only does it have potent magical properties, but it also feeds many of de beasts we train or eat ourselves.$b$bHowever, de Blood Trolls have been dumping a lot of cursed blood in de rivers. It may not be their goal, but if we do not act soon, de pollution may wipe out all de riverbud.$b$bI need you to take dis handful of seeds, and plant dem in de rivermud. In exchange, I will teach you how to harvest it more effectively.', `VerifiedBuild`=31478 WHERE `ID`=51230; -- -Unknown-
