UPDATE `quest_template` SET `RewardBonusMoney`=230, `QuestDescription`='Earlier today, King Wrynn addressed the citizens of Stormwind at Lion\'s Rest in a speech given to formally announce the end of the war.\n\nAfter the crowd departed, I met privately with the King and his advisors to discuss a mysterious substance that has been found in Silithus.\n\nThis glowing ore appears to be most powerful and the Horde has wasted no time in extracting it from the great wound.\n\nThe king has ordered me to fill you in on the details, in preparation for an important mission.', `VerifiedBuild`=31478 WHERE `ID`=49976; -- -Unknown-
