UPDATE `quest_template` SET `QuestDescription`='Right, then. First order of business, rescue the remnants of my company. \n\nThese sethrak kept yelling about expanding their empire and conquering Azeroth as they attacked us. Lovely, really.\n\nThey killed most of my company and took some hostages. I assume they\'re being told how grand the sethrak empire is.\n\nI\'d like the remnants of my company back, if you please. I\'ll put in a good word with Lady Sylvanas, once this is all over. \n\n...not that someone like you needs it.', `VerifiedBuild`=31478 WHERE `ID`=48496; -- -Unknown-
