UPDATE `quest_template` SET `RewardBonusMoney`=22000, `QuestDescription`='$n, our spies have discovered a fiendish plot! The Dark Iron dwarves want our beloved Brewfest destroyed!$B$BCoren Direbrew, head of a renegade family of brewers, has marshaled the dwarves of Blackrock Depths. Their vile mole machines attack us constantly.$B$BOur spy is in the Grim Guzzler, a tavern in the bowels of Blackrock Depths. He\'ll know more of Direbrew\'s plot.$B$BFind our spy. Save Brewfest!', `VerifiedBuild`=31478 WHERE `ID`=12318; -- Save Brewfest!
UPDATE `quest_template` SET `LogDescription`='Use the Alcohol-Free Brewfest Sampler to hit S.T.O.U.T. 5 times.', `QuestDescription`='Hey, you look like you\'ve got a good arm!\n\nLook, I\'ll give it to you straight. Sometimes we have a bit of trouble with the ale rampaging around the campgrounds. We paid good money to get these vendors and their brew here! We can\'t be wasting any of it, let alone having it come alive!\n\nThe easiest way to return the ale to its proper form is to throw a mug at it. Drink from the samplers and throw the mug at S.T.O.U.T. here. Prove that you\'ll be able to defend our property!', `VerifiedBuild`=31478 WHERE `ID`=12191; -- Chug and Chuck!
UPDATE `quest_template` SET `LogDescription`='Use the Alcohol-Free Brewfest Sampler to hit S.T.O.U.T. 5 times.', `QuestDescription`='Hey there! You look like you can handle your brew.\n\nBut can you handle your brew mug?\n\nWe\'ve been having a bit of trouble with the ale causing chaos around the camp. We\'ve found the best way to stop it is to recapture any living ale by throwing a mug at it!\n\nLooks like you could use some practice. If you can hit S.T.O.U.T., you can probably help out next time the ale springs to life again. Pick up a sampler, take a drink, and toss!', `VerifiedBuild`=31478 WHERE `ID`=12022; -- Chug and Chuck!
