UPDATE `quest_template` SET `QuestDescription`='Am I glad you\'re here. We are in big trouble! There\'s been a brew accident on the road to Bladefist Bay, and kegs are no longer being transported. You gotta get us that brew!$b$bI\'ll put you on one of my racing rams and you follow the road to Bladefist Bay.$b$bOnce you get near him he\'ll toss you a keg, then you run the keg back here and toss the keg to my more capable assistant. For now, all we want are 3 kegs. Do a good job and maybe we\'ll have another job for you.', `VerifiedBuild`=31478 WHERE `ID`=11412; -- There and Back Again
UPDATE `quest_template` SET `QuestDescription`='So you want to check out the racing rams? The dwarves think they have got a handle on it, but let\'s be honest, they are drunk most of the time, so how hard can it really be?$b$bNow before I let you strut your stuff, you\'ll need to show me that you can handle these fine, legally obtained creatures.$b$bSo here\'s the deal: I\'ll lend you the use of a ram. You need to prove to me that you can handle using these rams.$b$bKeep the ram at a trot, canter and gallop for 8 seconds each.', `VerifiedBuild`=31478 WHERE `ID`=11409; -- Now This is Ram Racing... Almost.
